import './App.css';
import Sidebar from './defultComponent/sidebar';

function App() {
  return (
    // < Sidebar />
    <Router>
      <Routes>
        <Route path='/' element={<HomePage/>}/>
        <Route path='/m' element={<HomePage/>}/>
      </Routes>
    </Router>
  );
}

export default App;

